
function getOriginalParent(parentPackage) {
    return {
        spentTime: parentPackage.spentTime,
        laborCosts: parentPackage.laborCosts,
        materialCosts: parentPackage.materialCosts,
        overallCosts: parentPackage.overallCosts,

        // workPackage or Project or something else
        _type: parentPackage._type,
        id: parentPackage.id,
        lockVersion: parentPackage.lockVersion,
        subject: parentPackage.subject,
        description: parentPackage.description,
        startDate: parentPackage.startDate,
        dueDate: parentPackage.dueDate,
        estimatedTime: parentPackage.estimatedTime,
        derivedEstimatedTime: parentPackage.derivedEstimatedTime,
        percentageDone: parentPackage.percentageDone,
        createdAt: parentPackage.createdAt,
        updatedAt: parentPackage.updateAt,
        remainingTime: parentPackage.remainingTime,

        // links
        category: parentPackage._links.category.title,
        // workPackageType userDefined
        type: parentPackage._links.type.title,
        project: parentPackage._links.project.title,
        priority: parentPackage._links.priority.title,
        status: parentPackage._links.status.title,
        author: parentPackage._links.author.title,
        _links: {
            parent: {
                href: parentPackage._links.parent.href,
                title: parentPackage._links.parent.title,
            }
        }
    }
}

function checkLeftOvers(leftOvers, possibleParent) {
    for (let i = 0; i < leftOvers.length; i++) {
        let parentId = (possibleParent._links.parent && possibleParent._links.parent.href)? parseInt(possibleParent._links.parent.href.split('/').pop()): null
        if (parentId === possibleParent.id) {
            delete possibleParent._links.parent.href
            possibleParent.children ? possibleParent.children.push(leftOvers[i]) : possibleParent.children = [leftOvers[i]]
            possibleParent.count = possibleParent.children.length
            const addedObj = leftOvers.splice(i, 1)
            checkLeftOvers(leftOvers, addedObj[0])
        }
    }
}

function findParent(possibleParents, possibleChild) {
    // getOriginalParent()
    let found = false
    for (let i = 0; i < possibleParents.length; i++) {
        let parentId = (possibleChild._links.parent && possibleChild._links.parent.href)? parseInt(possibleChild._links.parent.href.split('/').pop()) : null
        if (possibleParents[i].id === parentId) {
            found = true
            delete possibleChild._links.parent.href
            if (possibleParents[i].children) possibleParents[i].children.push(possibleChild)
            else possibleParents[i].children = [possibleChild]
            possibleParents[i].count = possibleParents[i].children.length
            return true
        } else if (possibleParents[i].children) found = findParent(possibleParents[i].children, possibleChild)
    }
    return found;
}

function refactorObj(workPackages) {

    const nested = workPackages.reduce((initial, value, index, original) => {

        // console.log(value)
        // let parentId = parseInt(possibleParents._links.parent.href.split('/').pop())
        if (!value._links.parent || !value._links.parent.href) {
            if (initial.left.length) checkLeftOvers(initial.left, value)
            delete value._links.parent.href
            value.root = true;
            initial.nested.push(getOriginalParent(value))
        }
        else {
            let parentFound = findParent(initial.nested, value)
            if (parentFound) checkLeftOvers(initial.left, value)
            else initial.left.push(getOriginalParent(value))
        }
        return index < original.length - 1 ? initial : initial.nested
    }, { nested: [], left: [] })
    console.log(nested.length)
    return nested;
}

